<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>NFL Games</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }
        body {
            background: #111;
            color: #fff;
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;
            padding: 20px;
        }
        .year-select {
            text-align: center;
            margin-bottom: 20px;
        }
        .year-select select {
            font-size: 18px;
            padding: 8px 16px;
            background: #222;
            color: #fff;
            border: 1px solid #444;
            border-radius: 4px;
            cursor: pointer;
        }

        .legend {
            display: flex;
            justify-content: center;
            gap: 20px;
            margin-bottom: 25px;
            flex-wrap: wrap;
        }
        .legend-box {
            background: #1a1a1a;
            border-radius: 8px;
            padding: 12px 20px;
            border: 3px solid;
            text-align: center;
            min-width: 180px;
            cursor: pointer;
            transition: opacity 0.2s;
        }
        .legend-box:hover {
            opacity: 0.8;
        }
        .legend-box.green { border-color: #22c55e; }
        .legend-box.red { border-color: #ef4444; }
        .legend-box.gray { border-color: #888; }
        .legend-box.selected {
            box-shadow: 0 0 0 2px #fff;
        }
        .legend-box .count {
            font-size: 28px;
            font-weight: bold;
            margin-bottom: 4px;
        }
        .legend-box.green .count { color: #22c55e; }
        .legend-box.red .count { color: #ef4444; }
        .legend-box.gray .count { color: #888; }
        .legend-box .label {
            font-size: 12px;
            color: #888;
        }

        .games {
            display: grid;
            grid-template-columns: repeat(4, 1fr);
            gap: 12px;
            max-width: 1200px;
            margin: 0 auto;
        }
        .game {
            background: #1a1a1a;
            border-radius: 8px;
            padding: 12px;
            border: 3px solid #333;
        }
        .game.winner-fewer { border-color: #22c55e; }
        .game.winner-more { border-color: #ef4444; }
        .game.equal { border-color: #888; }
        .game.hidden { display: none; }

        .team-row {
            display: flex;
            justify-content: space-between;
            align-items: center;
            padding: 4px 0;
            font-size: 14px;
        }
        .team-row.winner {
            font-weight: bold;
        }
        .team-row.loser {
            color: #666;
        }

        .team-name {
            flex: 1;
        }
        .score {
            width: 30px;
            text-align: right;
            margin-right: 12px;
        }
        .turnovers {
            width: 35px;
            text-align: right;
            color: #888;
            font-size: 13px;
        }

        .summary {
            margin-top: 8px;
            padding-top: 8px;
            border-top: 1px solid #333;
            font-size: 11px;
            color: #888;
            line-height: 1.4;
        }

        .bottom-stats {
            max-width: 1200px;
            margin: 40px auto 0;
            padding: 20px;
            background: #1a1a1a;
            border-radius: 8px;
            text-align: center;
            color: #888;
            font-size: 14px;
        }

        @media (max-width: 900px) {
            .games { grid-template-columns: repeat(2, 1fr); }
        }
        @media (max-width: 500px) {
            .games { grid-template-columns: 1fr; }
        }
    </style>
</head>
<body>

        <div class="legend-box gray" id="boxEqual" data-filter="equal">

            <div class="label">Turnovers tied</div>
        </div>
        <div class="legend-box red" id="boxMore" data-filter="more">

            <div class="label">More turnovers & won</div>

    </div>

    const byYear = {};
    games.forEach(g => {
        if (!byYear[g.year]) byYear[g.year] = [];
        byYear[g.year].push(g);
    });

    const yearSelect = document.getElementById('yearSelect');
    const years = Object.keys(byYear).sort((a,b) => b - a);
    years.forEach(y => {
        const opt = document.createElement('option');
        opt.value = y;
        opt.textContent = y;
        yearSelect.appendChild(opt);
    });

    let currentFilter = null;

    function applyFilter(filter) {
        if (currentFilter === filter) {
            // Clicking same filter again - clear it
            currentFilter = null;
            document.querySelectorAll('.legend-box').forEach(b => b.classList.remove('selected'));
            document.querySelectorAll('.game').forEach(g => g.classList.remove('hidden'));
        } else {
            currentFilter = filter;
            document.querySelectorAll('.legend-box').forEach(b => {
                b.classList.toggle('selected', b.dataset.filter === filter);
            });
            document.querySelectorAll('.game').forEach(g => {
                if (filter === 'fewer') {
                    g.classList.toggle('hidden', !g.classList.contains('winner-fewer'));
                } else if (filter === 'equal') {
                    g.classList.toggle('hidden', !g.classList.contains('equal'));
                } else if (filter === 'more') {
                    g.classList.toggle('hidden', !g.classList.contains('winner-more'));
                }
            });
        }
    }

    document.querySelectorAll('.legend-box').forEach(box => {
        box.addEventListener('click', () => applyFilter(box.dataset.filter));
    });

    function renderYear(year) {
        const yearGames = byYear[year];
        const container = document.getElementById('games');
        container.innerHTML = '';
        currentFilter = null;
        document.querySelectorAll('.legend-box').forEach(b => b.classList.remove('selected'));

        let fewerWon = 0, moreWon = 0, equalTO = 0;

        yearGames.forEach(g => {
            if (g.winner === 'tie') return;

            const div = document.createElement('div');
            div.className = 'game';

            const homeWon = g.winner === 'home';
            const winner = homeWon ? g.home_team : g.away_team;
            const loser = homeWon ? g.away_team : g.home_team;
            const winnerTO = homeWon ? g.home_turnovers : g.away_turnovers;
            const loserTO = homeWon ? g.away_turnovers : g.home_turnovers;

            let summary;
            if (winnerTO < loserTO) {
                summary = `${winner} (winner) had fewer turnovers than ${loser}`;
                div.classList.add('winner-fewer');
                fewerWon++;
            } else if (winnerTO > loserTO) {
                summary = `${winner} (winner) had more turnovers than ${loser}`;
                div.classList.add('winner-more');
                moreWon++;
            } else {
                summary = `Both teams had ${winnerTO} turnover${winnerTO !== 1 ? 's' : ''}`;
                div.classList.add('equal');
                equalTO++;
            }

            div.innerHTML = `
                <div class="team-row ${homeWon ? 'winner' : 'loser'}">
                    <span class="team-name">${g.home_team}</span>
                    <span class="score">${g.home_score}</span>
                    <span class="turnovers">${g.home_turnovers} TO</span>
                </div>
                <div class="team-row ${homeWon ? 'loser' : 'winner'}">
                    <span class="team-name">${g.away_team}</span>
                    <span class="score">${g.away_score}</span>
                    <span class="turnovers">${g.away_turnovers} TO</span>
                </div>
                <div class="summary">${summary}</div>
            `;

            container.appendChild(div);
        });

        document.getElementById('countFewer').textContent = fewerWon;
        document.getElementById('countEqual').textContent = equalTO;
        document.getElementById('countMore').textContent = moreWon;

        const total = fewerWon + moreWon + equalTO;
        document.getElementById('bottomStats').innerHTML = `
            ${year} Season: ${fewerWon} of ${total} games (${Math.round(100*fewerWon/total)}%) won by team with fewer turnovers
        `;
    }

    yearSelect.addEventListener('change', e => renderYear(e.target.value));
    renderYear(years[0]);
    </script>
